const LeagueStandings = ({ data }: { data: any}) => {
	const sorted = data.sort((a, b) => a.points - b.points)
	return (
		<div>
			{sorted.map((position) => (
				<div key={position._id}>
					{position.member.username} - {position.points}
				</div>
			))}
		</div>
	)
}

export default LeagueStandings
